import React from 'react';
import Select from 'react-select';
import 'rsuite/DateRangePicker/styles/index.css';
function Filter() {
	const options = [
		{ value: 'chocolate', label: 'Chocolate' },
		{ value: 'strawberry', label: 'Strawberry' },
		{ value: 'vanilla', label: 'Vanilla' },
	];
	return (
		<div className="flex justify-content-center">
			<div className="bg-white w-3/4 h-[150px] rounded-xl flex justify-content-between align-items-center p-10 gap-1">
				<div>FROM</div>
				<Select
					isMulti
					className="w-full "
					options={options}
					placeholder={'City, airport or country'}
					closeMenuOnSelect={false}
				/>
				<div>FROM</div>
				<Select
					isMulti
					className="w-full"
					placeholder={'City, airport or country'}
				/>
				<Select className="w-full" placeholder={'Departure'} isMulti />
				<Select className="w-full" placeholder={'Return'} isMulti />
				<button class="rounded-lg bg-[#c94f42] px-8 py-2  text-white outline-none hover:opacity-80 focus:ring">
					EXPLORE
				</button>
			</div>
		</div>
	);
}

export default Filter;
